import React, { Component } from "react";
import "./../About/About.css";
export default class About extends Component {
  state = {
    userName: "mahmoud",
    lastName: "kadry",
    job: "idk",
    age: "26",
    productList: [
      { pName: "xaiomi", pPrice: 3000, pCat: "mobile", pId: 11 },
      { pName: "apple", pPrice: 35000, pCat: "mobile", pId: 13 },
      { pName: "samsung", pPrice: 45000, pCat: "mobile", pId: 14 },
    ],
  };
  render() {
    return (
      <>
        <div className="container">
          <div className="row justify-content-between">
            {this.state.productList.map((product) => {
              return <Child product={product} />(
                <>
                  <div className="card text-start col-md-3 ">
                    <div className="card-body">
                      
                    </div>
                  </div>
                </>
              );
            })}
          </div>
        </div>
      </>
    );
  }
}
